import React from "react";
import { Select, Form, Input, Button, Upload, InputNumber } from "antd";
import { useAddRecipe } from "../../context/AddRecipeContext";
import "./RecipeForm.scss";

function RecipeForm() {
  const {
    normFile,
    onFinish,
    beforeUpload,
    handleChange,
    uploadButton,
    form,
    imageUrl,
    validateMessages,
  } = useAddRecipe();

  return (
    <div>
      <Form
        style={{
          maxWidth: 600,
        }}
        validateMessages={validateMessages}
        initialValues={{
          requiredMarkValue: requiredMark,
        }}
        onValuesChange={onRequiredTypeChange}
        className="recipe-form"
        form={form}
        name="addRecipeForm"
        onFinish={onFinish}
        layout="vertical"
        scrollToFirstError={true}
      >
        {/*Input For Recipe Title */}
        <Form.Item
          label="Recipe Title:"
          name="title"
          className="recipe-title"
          colon={true}
          rules={[
            { required: true, message: "Please input the Recipe Title!" },
          ]}
        >
          <Input placeholder="Title" />
        </Form.Item>

        {/*Input For Recipe Image */}
        <Form.Item
          label="Recipe image:"
          name="image"
          getValueFromEvent={normFile}
          valuePropName="fileList"
          noStyle
          className="upload"
        >
          <Upload
            name="avatar"
            accept="image/png, image/jpeg"
            listType="picture"
            className="avatar-uploader"
            showUploadList={false}
            action="https://run.mocky.io/v3/435e224c-44fb-4773-9faf-380c5e6a2188"
            beforeUpload={beforeUpload}
            onChange={handleChange}
          >
            {imageUrl ? (
              <img
                src={imageUrl}
                alt="avatar"
                style={{
                  height: "200px",
                  objectFit: "fill",
                }}
              />
            ) : (
              uploadButton
            )}
          </Upload>
        </Form.Item>

        {/*Input For Recipe Description */}
        <Form.Item
          label="Description:"
          name="description"
          rules={[
            { required: true, message: "Please input the Recipe Description!" },
          ]}
        >
          <Input placeholder="Description" />
        </Form.Item>

        {/*Input For Recipe Ingredientss */}
        <Form.Item
          label="Ingredients:"
          name="ingredients"
          rules={[
            { required: true, message: "Please input the Recipe Ingredients!" },
          ]}
        >
          <Input.TextArea placeholder="Ingredients" />
        </Form.Item>

        {/*Input For Recipe Instructions */}
        <Form.Item
          label="Instructions:"
          name="directions"
          rules={[
            { required: true, message: "Please input the Recipe Directions!" },
          ]}
        >
          <Input.TextArea placeholder="Directions" />
        </Form.Item>

        {/*Input For Recipe Servings*/}
        <Form.Item
          label="Servings:"
          name="serving"
          rules={[
            { required: true, message: "Please input the Recipe Serving!" },
          ]}
        >
          <Input placeholder="Serving" />
        </Form.Item>

        {/*Input For Recipe Cooking Time*/}
        <Form.Item
          label="Cooking Time:"
          name="cooking"
          className="cooking-time"
          rules={[
            {
              required: true,
              message: "Please input the Recipe Cooking time!",
            },
          ]}
        >
          <InputNumber
            placeholder="Cooking Time"
            className="cooking-time-input"
          />
        </Form.Item>

        {/*Input For Recipe Prep Time*/}
        <Form.Item
          label="Prep Time:"
          name="prep"
          className="prep-time"
          rules={[
            {
              required: true,
              message: "Please input the Recipe Preparation time!",
            },
          ]}
        >
          <InputNumber placeholder="Prep Time" className="prep-time-input" />
        </Form.Item>

        {/*Input For Recipe cuisine*/}
        <Form.Item
          label="Cuisine:"
          name="cuisine"
          rules={[{ required: true, message: "Please select the cuisine!" }]}
        >
          <Select defaultValue="Select Cuisine" style={{ width: 200 }}>
            <Select.Option value="Thai">Thai</Select.Option>
            <Select.Option value="Chinese">Chinese</Select.Option>
            <Select.Option value="Arabian">Arabian</Select.Option>
          </Select>
        </Form.Item>

        {/*Input For Recipe Collection*/}
        <Form.Item
          label="Collection:"
          name="collection"
          rules={[
            { required: true, message: "Please select the Recipe Collection!" },
          ]}
        >
          <Select defaultValue="Select Collection" style={{ width: 200 }}>
            <Select.Option value="New Collection">New Collection</Select.Option>
            <Select.Option value="Cook Book">Cook Book</Select.Option>
            <Select.Option value="My Recipe">My Recipe</Select.Option>
          </Select>
        </Form.Item>

        {/*Input For Recipe Nutrition Facts*/}
        <Form.Item label="Nutrition Facts:" name="facts">
          <Input placeholder="Nutrition Facts" />
        </Form.Item>

        <Form.Item wrapperCol={{ offset: 8, span: 16 }}>
          <Button type="primary" htmlType="submit">
            Submit
          </Button>
        </Form.Item>
      </Form>
    </div>
  );
}

export default RecipeForm;
